import ReactDOM from "react-dom";
import App from "./App";
import { BrowserRouter } from "react-router-dom"
import "./index.css";
import 'react-slideshow-image/dist/styles.css';

ReactDOM.render(
    <BrowserRouter>

        <App />

    </BrowserRouter>,
        document.getElementById("root")
)
